import{_ as r,c as t,a5 as l,G as o,B as i,o as s}from"./chunks/framework.O9ad3XaM.js";const n="/assets/1.CCF1cmdc.PNG",p="/assets/2.DvkdqFHB.PNG",c="/assets/3.Bwv42gGE.PNG",h="/assets/trollstone_i.B8qvue8p.png",u="/assets/4.B5geXstn.PNG",S="/assets/trollstone_v.B8Iki7WS.png",d="/assets/troll-icon.IcsLe8Ta.jpg",g="/assets/troll-idid.D5hKaJET.PNG",m="/assets/troll-ui.DDlPPyCG.PNG",A=JSON.parse('{"title":"在 iOS 上安装 PojavLauncher","description":"","frontmatter":{"title":"在 iOS 上安装 PojavLauncher","sidebar_position":2},"headers":[],"relativePath":"Java/process/mobile-player/Pojav_iOS.md","filePath":"nitwikit/docs-java/process/mobile-player/Pojav_iOS.md","lastUpdated":1732237030000}'),_={name:"Java/process/mobile-player/Pojav_iOS.md"};function O(v,a,b,P,f,j){const e=i("nw-image-viewer");return s(),t("div",null,[a[0]||(a[0]=l('<h1 id="在-ios-上安装-pojavlauncher" tabindex="-1">在 iOS 上安装 PojavLauncher <a class="header-anchor" href="#在-ios-上安装-pojavlauncher" aria-label="Permalink to &quot;在 iOS 上安装 PojavLauncher&quot;">​</a></h1><p>免越狱安装 PojavLauncher_iOS</p><p><s>(当然如果下面几个方法都不成功那恭喜你只能去越狱了)</s></p><h2 id="方法一-使用牛蛙助手" tabindex="-1">方法一: 使用牛蛙助手 <a class="header-anchor" href="#方法一-使用牛蛙助手" aria-label="Permalink to &quot;方法一: 使用牛蛙助手&quot;">​</a></h2><h3 id="安装-pojavlauncher" tabindex="-1">安装 PojavLauncher <a class="header-anchor" href="#安装-pojavlauncher" aria-label="Permalink to &quot;安装 PojavLauncher&quot;">​</a></h3><p>在电脑打开此 <a href="https://ios222.com/" target="_blank" rel="noreferrer">链接</a> 下载牛蛙助手</p><p>使用数据线连接手机与电脑，按照提示安装</p><p>从此 <a href="https://github.com/PojavLauncherTeam/PojavLauncher_iOS/releases" target="_blank" rel="noreferrer">链接</a> 下载 Pojav 的 ipa 安装包</p><p>在手机上的牛蛙助手中导入 ipa 文件 <img src="'+n+'" alt=""></p><p>点击签名进行自签(刚开始用自签会被封号，不会很严重修改密码就好了，自签只有一周的使用时间，过了时间要重新签名) <img src="'+p+'" alt=""></p><p>点击进行安装 <img src="'+c+'" alt=""></p><h3 id="启动-pojavlauncher" tabindex="-1">启动 PojavLauncher <a class="header-anchor" href="#启动-pojavlauncher" aria-label="Permalink to &quot;启动 PojavLauncher&quot;">​</a></h3><p>打开牛蛙助手，点击 JIT，使用 JIT 启动 PojavLauncher</p><h3 id="补充" tabindex="-1">补充 <a class="header-anchor" href="#补充" aria-label="Permalink to &quot;补充&quot;">​</a></h3><p>安装完之后若点击程序出现未受信任的提示 <img src="'+h+'" alt=""> 请打开设置 → 通用 → VPN 与设备管理， 点击对应的配置描述文件信任它</p><p>若牛蛙提示下图，就按它说的打开牛蛙的 VPN <img src="'+u+'" alt=""></p><h2 id="方法二-使用-trollstore" tabindex="-1">方法二: 使用 TrollStore <a class="header-anchor" href="#方法二-使用-trollstore" aria-label="Permalink to &quot;方法二: 使用 TrollStore&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>由于苹果公司修复了 iOS 系统中的相关漏洞，巨魔商店不再支持 iOS16.7 和 iOS17.1 及以上系统。</p></div><p>点击查看 <a href="https://ios.cfw.guide/installing-trollstore/" target="_blank" rel="noreferrer">TrollStore 的安装流程</a><img src="'+S+'" alt=""></p><details><summary>各苹果机型对应的 TrollStore 安装方法</summary><p>安装 TrollStore 的方法因设备而异，这里简单分类了 TrollStore 的辅助工具。(iOS 版本号和 iPadOS 版本号按照相同版本号计算)</p><p>如果你是：</p><ul><li>iOS14-beta2～iOS14.8.1 的系统(A8～A11 处理器)</li><li>iOS15.5 系统(A9～A11 处理器)</li><li>iOS15.6 beta4～iOS15.6.1(A9～A11 处理器)</li><li>iOS15.7～iOS15.8.2(A9～A17，M1～M2 处理器)</li><li>iOS16 beta1～beta3(A9～A11 处理器)</li><li>iOS16 beta4～iOS16.6.1(A9 以上，M1～M2 处理器)</li><li>iOS17 beta1～beta4(A9～A11 处理器)</li></ul><p>那么 <a href="https://ios.cfw.guide/installing-trollstore-trollinstallerx/" target="_blank" rel="noreferrer">点此查看</a> TrollInstallerX 的安装方法。 <strong>(非常之复杂，怕麻烦的，没电脑的，没有苹果官方 Type C 转 Lighting 或者 C2C 的线的，但是又只能用这个方法安装 TrollStore 的劝退)</strong></p><p>如果你是：</p><ul><li>iOS14-beta2～iOS14.8.1的系统(A12 以上，M1～M2处理器)</li><li>iOS15～iOS15.5 beta4(A8 以上，M1～M2 处理器)</li><li>iOS15.5 系统(A12 以上，M1～M2 处理器)</li><li>iOS15.6 beta4～iOS15.6.1(A12 以上，M1～M2 处理器)</li><li>iOS16 beta1～beta3(A12 以上，M1～M2 处理器)</li></ul><p>那么复制此链接到你的 Safari 浏览器地址栏 <code>itms-services://?action=download-manifest&amp;url=https://jailbreaks.app/cdn/plists/TrollHelper.plist</code> 以此安装 TrollHelperOTA，然后<strong>按顺序</strong>点击 Register Persistence Helper 和 Install TrollStore 即可安装。<strong>(期间可能黑屏或重启。)</strong></p><p>如果你是：</p><ul><li>iOS16.7RC(A9～A11 处理器)</li><li>iOS17 beta5～iOS17.0(A9～A11 处理器)</li></ul><p>那么你需要一个<strong>已经越狱了</strong>的苹果设备按照 <a href="https://ios.cfw.guide/installing-trollstore-trollhelper/" target="_blank" rel="noreferrer">这个教程</a> 使用 TrollHelper 安装 TrollStore。 <s>(你手机都越狱了还用 TrollStore 干嘛，直接用其他 ipa/dpkg 包管理安装 Pojav</s></p><p>如果你是：</p><ul><li>iOS15.5(A8 处理器)</li><li>iOS15.6 beta4～iOS15.6.1(A8 处理器)</li></ul><p>那么 <a href="https://ios.cfw.guide/installing-trollstore-trollinstallermdc/" target="_blank" rel="noreferrer">点此查看</a> TrollInstallerMDC 的安装方法。 <strong>(较复杂，怕麻烦的，没电脑的，没有苹果官方 Type C 转Lighting 或者 C2C 的线的，但是又只能用这个方法安装 TrollStore 的劝退)</strong></p><p>如果你是：</p><ul><li>iOS15.7.2～iOS15.8.2(A8处理器)</li></ul><p>那么 <a href="https://ios.cfw.guide/installing-trollstore-trollmisaka" target="_blank" rel="noreferrer">点此查看</a> TrollMisaka 的安装方法。 <strong>(也挺复杂，怕麻烦的，没电脑的，没有苹果官方 Type C 转 Lighting 或者 C2C 的线的，但是又只能用这个方法安装 TrollStore 的劝退)</strong></p></details><p>总之，当你<s>终于</s>历经千辛万苦安装完 TrollStore 之后，你的内心可能痛苦，可能舒畅；但不管怎么样，最痛苦的过程结束了，后面的 Pojav 安装将会异常轻松。 <img src="'+d+'" alt=""></p><p>现在你应该能看见这个图标了。</p><p>现在，你需要从 <a href="https://github.com/PojavLauncherTeam/PojavLauncher_iOS/actions" target="_blank" rel="noreferrer">此链接</a> 下载 PojavLauncher 的 ipa 安装包。</p><p>下载的时候有<strong>两个注意事项</strong>： 1.你需要一个 GitHub 账号，不然你没法在 Actions 里面下载东西。 2.你使用的是 TrollStore 方案，那么就下载 <code>net.kdt.pojavlauncher-ios-trollstore.tipa</code>，<s>别告诉我你用的是 TVOS</s>。</p><p>下载完 Pojav 安装包后，我们来到 TrollStore 里面。 <img src="'+g+'" alt=""> 咱们要打开 ldid，以确保能正常安装没有签名的安装包。</p><p>然后回到主界面，点击右上角加号，选择你刚刚下载的 tipa 文件，点击，然后就会安装，安装完之后差不多是这样的。 <img src="'+m+'" alt=""></p><p><s>(你不用管 DolphiniOS 干什么的，这是用来玩老游戏的模拟器)</s></p><p>然后点击 PojavLauncher，选择 Open with JIT，打开 Pojav 后就能正常使用了。</p><h2 id="方法三-使用-altstore" tabindex="-1">方法三：使用 AltStore <a class="header-anchor" href="#方法三-使用-altstore" aria-label="Permalink to &quot;方法三：使用 AltStore&quot;">​</a></h2><p>后面即将补充</p>',30)),o(e)])}const k=r(_,[["render",O]]);export{A as __pageData,k as default};
